'<p>This is an extended post. This means you only see this small teaser by default and you must click on the link below to see more.</p>' => '<p>这是一个扩展文章。这意味着您在默认情况下只看到这个小的预告并且您必须点击下面的链接才能查看更多。</p>',
'Extended post' => '扩展的文章',
'<p>This post has a special post type called "Post with custom fields".</p>' => '<p>这篇文章有一个特殊的文章类型，名为 ”自定义字段的文章“。</p>',
'Custom Fields Example' => '自定义字段示例',
'<p>This post type defines 4 custom fields.</p>' => '<p>这篇文章类型定义了 4 个自定义字段。</p>',
'<p>This post has sample values for these for 4 fields. You can see them below</p>' => '<p>这篇文章中的 4个 自定义字段都有示例值。如下所示：</p>',
'<p>This post has a special post type called "Child Post".</p>' => '<p>这篇文章有一个特殊的文章类型，称为 ”子文章“。</p>',
'Child Post Example' => '子文章示例',
"<p>This post has several images attached to it. Each one uses a different Attachment Position. Each may be displayed differently depending on the skin they are viewed in.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>这篇文章有几张附图。每一张图都使用了不同的挂载位置。可能会由于所选择的皮肤不同，其页面元素定义的不同而导致页面显示也略有不同。</p>\n\n<p>请查看图片博客 （可通过顶部链接访问） 去查看一个完全不同的皮肤。图片博客的皮肤更侧重于展示照片，相比之下，通用博客则侧重于文字。</p>",
'Image post' => '图片文章',
'Welcome to your b2evolution-powered website!' => '欢迎您来到 b2evolution 网站！',
"<p>To get you started, the installer has automatically created several sample collections and populated them with some sample contents. Of course, this starter structure is all yours to edit. Until you do that, though, here's what you will find on this site:</p>\n\n<ul>\n<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n<li><strong>Blog B</strong>: You can access it from the link at the top of the page. It contains information about more advanced features. Note that it is deliberately using a different skin from Blog A to give you an idea of what's possible.</li>\n<li><strong>Photos</strong>: This collection is an example of how you can use b2evolution to showcase photos, with photos grouped into photo albums.</li>\n<li><strong>Forums</strong>: This collection is a discussion forum (a.k.a. bulletin board) allowing your users to discuss among themselves.</li>\n<li><strong>Manual</strong>: This showcases how b2evolution can be used to publish structured content such as an online manual or book.</li>\n\n</ul>\n\n<p>You can add new collections of any type (blog, photos, forums, etc.), delete unwanted one and customize existing collections (title, sidebar, blog skin, widgets, etc.) from the admin interface.</p>" => "<p>在您开始之前，安装程序已自动创建了示例站点并填充一些示例内容。当然，这种开始形成的框架都要由您来编辑。直到您这样做，您会发现在这个网站有一些特点：</p>\n\n<ul>\n<li><strong>博客 A</strong>：您正在看到的即是它。它包含几篇示例文章，使用 b2evolution 的一些简单功能。</li>\n<li><strong>博客 B</strong>：您可以在页面的顶部链接访问它。它包含更高级的功能。注意，博客 B 特意使用了不同于博客 A 的皮肤，目的是为您提供一个创站想法。</li>\n<li><strong>照片博客</strong>：这个站点是一个如何使用 b2evolution 展示照片的例子，照片已分组存于相册中。</li>\n<li><strong>论坛</strong>：这个站点是一个论坛（又名公告栏），允许您的用户在此进行话题讨论。</li>\n<li><strong>手册</strong>：这个站点展示了如何使用 b2evolution 创建在线手册或像书一样的结构化内容。</li>\n\n</ul>\n\n<p>可以添加新的任何类型的站点（博客、图片、论坛等），删除不想要的内容或者通过管理界面进一步定制现有的站点（标题、侧边栏、博客皮肤、挂件等）。</p>",
'b2evo skins repository' => 'b2evo 皮肤库',
'About Blog B' => '关于博客 B',
'Blog B' => '博客 B',
"<p>This is the intro post for the front page of Blog B.</p>\n\n<p>Blog B is currently configured to show a front page like this one instead of directly showing the blog's posts.</p>\n\n<ul>\n<li>To view the blog's posts, click on \"News\" in the menu above.</li>\n<li>If you don't want to have such a front page, you can disable it in the Blog's settings > Features > <a %s>Front Page</a>. You can also see an example of a blog without a Front Page in Blog A</li>\n</ul>" => "<p>这是博客 B 前台页面展示简介的部分。</p>\n\n<p>博客 B 目前配置为在首页显示一个前台页面，就像现在展示的一样，而不是直接显示博客的文章。</p>\n\n<ul>\n<li>要查看博客，在上面的菜单中点击 \"最新\"。</li>\n<li>如果您不想要这样的前台页面，您可以在 博客设置 > 功能 ><a %s>前面页面</a> 中禁用它。您还可以查看无前博客 A，那里没有展示前台页面</li>\n</ul>",
'Welcome to Blog B' => '欢迎光临博客 B',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => '这里使用了 “介绍-分类” 的文章类型，并被附加到所需的分类里（ies）。',
'b2evolution tips category &ndash; Sub Intro post' => 'b2evolution 提示分类 &ndash; 子介绍文章',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => '这里使用了 “介绍-标签” 的文章类型，并被标记为所需要的标签（组）。',
'Widgets tag &ndash; Sub Intro post' => '标签挂件 &ndash; 子介绍文章',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => "<p>这是一个置顶文章示例。</p>\n\n<p>只要没有设定特定的 “介绍” 文章，它将被置顶显示。您想要进一步查看，请尝试显示 ”公告“ 分类里的文章。</p>\n\n<p>此外注意当这个文章已置顶，它将不会出现在顺序的文章列表中。</p>",
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "<p>b2evolution 附带了一个 <code>.htaccess</code> 文件用于在您的WEB服务器上优化 b2evolution（如果您正在使用Apache）。在某些情况下，该文件可能在安装时不能自动激活。请查看在线手册页 <a %s>常见问题</a> 获取更多信息。</p>\n\n<p>想要进行进一步优化，请查看手册 <a %s>性能优化</a>。更改您当前服务器配置或者在您的 <a %s>web 主机</a> 空间商允许的情况下去做更改，它可以使 b2evolution 的执行速度增加 10 倍！</p>",
'Apache optimization...' => 'Apache 优化...',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => "<P>在默认情况下，会使用一个 evoskin 来显示博客。 （更多关于在另一篇文章中使用皮肤。）</p>\n<p>这意味着，博客是通过 '<code>index.php</code>' 来进行访问的，它从数据库加载默认参数，然后交给 皮肤 来解析显示。</p>\n<p>另外，如果您不想使用默认的数据库参数，并想要强制使用皮肤、分类或特定linkblog，您可以建立一个根文件，如所提供的  '<code>a_stub.php</code>'，并通过它取代 index.php 来访问您的博客。</p>\n<p>最后，如果您需要做一些非常具体的操作并自定义您的博客，您可以使用简单的模板，而不是使用皮肤。在这种情况下，通过一个完整的模板来调用您的博客，如所提供的 '<code>a_noskin.php</code>' </p>\n<p>如果您想将b2evolution博客集成到一个复杂的网站里，您可以想通过 复制/粘贴 代码 '<code>a_noskin.php</code>' 到您的网站上的一个页面来做到这一点。</p>\n<p>您可以在您的 stub/template 文件里获取更多信息。使用文本编辑器打开它们，阅读文件内容及相关说明。</p>\n<P>无论哪种方式，确保您以博客管理员身份为您的博客设置了正确的访问方法/URL。否则，固定链接将不能正常访问。</p>",
'Skins, Stubs, Templates &amp; website integration...' => '皮肤，静态化，模板和 &amp; 网站整合...',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>b2evolution 博客的生成使用了默认已选的挂件。例如，这个博客的侧边栏包括像日历，搜索栏，类别列表，XML源等部件。</p>\n\n<p>您可以从管理界面的博客设置选项卡中添加，删除和重新排列各部件。</p>\n\n<p>注：为了显示挂件，其存于容器中。每个容器出现在一个特定的 evoskin 中。如果您要改变您的博客皮肤，新的皮肤较比之前的皮肤可能使用的不是同一个容器。确保您挂件存于的容器在新皮肤中是存在的。</p>",
'About widgets...' => '关于挂件...',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"%s\" target=\"_blank\">manual on skins</a>!</p>" => "<p>在默认情况下，会使用 evoskin 来显示 b2evolution 博客。</p>\n\n<p>您可以在管理界面中通过编辑博客设置来更改使用任意的皮肤。</p>\n\n<p>您可以从<a href=\"http://skins.b2evolution.net/\" target=\"_blank\">皮肤站点</a>下载额外的皮肤。要安装它们，将其解压缩到 /blogs/skins 目录中，然后在管理界面中进入常规设置 &gt; 皮肤，单击“新建安装”</p>\n\n<p>您也可以通过复制，重命名和在 /blogs/skins 目录中自定义任何现有的皮肤文件夹来创建自己的皮肤。</p>\n\n<p>要开始自定义皮肤，打开“<code>index.main.php</code>”文件编辑并阅读里面的注释。注意：您还可以在管理界面的“文件”选项卡中编辑皮肤</p>\n\n<p>您还可以进一步阅读 <a href=\"%s\" target=\"_blank\">皮肤设置手册</a>！</p>",
'About skins...' => '关于皮肤...',
'About Photos' => '关于照片',
'Sunset' => '日落',
'Bus Stop Ahead' => '公交车站',
"Heading\n=======\n\nSub-heading\n-----------\n\n### H3 header\n\n#### H4 header ####\n\n> Email-style angle brackets\n> are used for blockquotes.\n\n> > And, they can be nested.\n\n> ##### Headers in blockquotes\n>\n> * You can quote a list.\n> * Etc.\n\n[This is a link](http://b2evolution.net/) if Links are turned on in the markdown plugin settings\n\nParagraphs are separated by a blank line.\n\n    This is a preformatted\n    code block.\n\nText attributes *Italic*, **bold**, `monospace`.\n\nShopping list:\n\n* apples\n* oranges\n* pears\n\nThe rain---not the reign---in Spain." => "标题\n=======\n\n副标题\n-----------\n\n### H3头\n\n#### H4头####\n\n>电子邮件样式的尖括号\n>用于引用文字。\n\n>>而且，他们可以嵌套。\n\n>#####引用文字标题\n>\n>*您可以给一个列表。\n>*等等\n\n[这是一个链接]（http://b2evolution.net/）如果链接在 markdown 插件中设置为开启\n\n段落是由空行分隔。\n\n    这是一个预格式化\n    代码块。\n\n文本属性*斜体*，**粗体**，`等宽`。\n\n购物清单：\n\n*苹果\n*橘子\n*梨\n\n雨---不是统治---在西班牙。",
